// src/App.js
import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import PublicRoutes from './components/PublicRoutes';  // Public route wrapper
import SignUp from './components/SignUp';
import Login from './components/Login';
import Dashboard from './components/Dashboard';
import PrivateRoutes from './components/PrivateRoutes'; // Private route wrapper

const App = () => {
  return (
    <Router>
      <Routes>
        {/* Public routes like login and signup */}
        <Route element={<PublicRoutes />}>
          <Route path="/signup" element={<SignUp />} />
          <Route path="/login" element={<Login />} />
        </Route>

        {/* Protected routes like the dashboard */}
        <Route element={<PrivateRoutes />}>
          <Route path="/dashboard" element={<Dashboard />} />
        </Route>

        {/* Add more routes as needed */}
      </Routes>
    </Router>
  );
};

export default App;
